import * as React from 'react';
import './fonts.css';
import { background, secondary } from './colors.js';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, button } from '@mui/material';

import Button from '@mui/material/Button';

const useStyles = makeStyles((theme) => ({
  textTheme: {
    color: secondary,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
    fontSize: '1.75em',
    letterSpacing: '0.1em',
    display: 'block'},
  textTheme: {
    color: secondary,
    fontWeight: 'bold !important',
    fontFamily: 'Montserrat',
    fontSize: '0.75em',
    letterSpacing: '0.1em',
    marginTop: '20px',
    marginRight: '50px',
    display: 'block'
  }
}));

const titleText = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  flex: 1,
  flexDirection: 'column',
};

const firstLetter = { fontSize: '1.3em' };

function TitleContent() {
  const classes = useStyles();
  return (
    <div style={titleText}>
      <div sx={classes.textTheme}>Ean Vandergraaf</div>
      <div sx={classes.textTheme}>Software Engineer</div>
      <div sx={classes.textTheme}>Ean Vandergraaf</div>
    </div>
  );
}

export default TitleContent;
